:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Edward Marsh and DAVIS, Jane
  JWILLIAMS, Arthur Frederick and THOMPSON, Leslie Elisabeth Antonia
  JWILLIAMS, Brian Leslie and HOLDERNESS, Patricia Mary
  04> WILLIAMS, Brian Leslie m on 27.08.1933 to HOLDERNESS, Patricia Mary
  b 19.01.1904 d 06.07.1979
  b 30.04.1914 d 05.12.1976
  Brian b. at Pukehou and d. at Waipukurau. Patricia, d/o Hildebrand Holderness and Cecil May McNeill, b, at
  Hastings and d. at Otane. Both cremated and ashes interred at Pukehou Cemetery.
  Brian was educated at Huntley School, Marton, and at Wanganui Collegiate School. He served as a farm cadet
  at Te Aute and Atua Station then took over Kutere at Otane where he farmed for the rest of his life.
  During the war he served in Egypt and Italy. Brian had a close association with Te Aute College. He was
  appointed to the Te Aute Trust Board in 1961 and played a leading part in the redevelopment of the College.
  He became a member of the Te Aute College Board of Governors when it was established in 1976. He was also
  supervisor of the College farm. Brian had a wide knowledge of local Maori whakapapa and history. He
  served on the advisory council for the Bishop of Aotearoa and the formation of the bishopric. In 1952 he
  became a member of the Henry and William Williams Memorial Trust and served as chairman from 1971 to 1979.
  In recognition of his work for the Maori people, on his death Brian was given a Maori 'Tangihanga' (funeral
  ceremony) at Te Aute College and elders came from all over Hawkes Bay to pay their tributes.
  Patricia was educated at Iona College, Havelock North. She was a breeder, exhibitor and judge of sporting
  dogs and a member of the Maori Women's Welfare League.
  01> WILLIAMS, Martin Brian m on 16.11.1957 to KENDRICK, Heather
  b 06.03.1934 d 25.03.1961
  b 25.07.1939
  Martin b, at Hastings, d. at Dannevirke, cremated at Hastings and ashes interred at Pukehou Cemetery.
  Heather remarried Jim Graham and has five children. Address: (Heather Graham) Papanui Farms, Karaka
  Road, Whenuapai, Auckland,
  Martin was educated at Huntley School, Marton and Wanganui Collegiate School where he was a member of
  the rowing eight. He worked with his father on "Kutere" for a short time then, after completing his
  Compulsory Military Training, he joined the Territorial Force. He gained his commission as 2nd
  Lieutenant in the Hawkes Bay Regiment in 1955 and had been promoted to Captain at the time of his
  death. He was killed in a road accident when his vehicle struck a bridge near Dannevirke.
  01> WILLIAMS, Kelly Brian m on 03.12.1983 to COOKE, Phillipa Jean
  b 18.06.1958
  b 25.08.1961
  Kelly b. at Waipawa and m, at Masterton. Phillipa, d/o Alan James Cooke and Christine Norah Ward,
  b, at Masterton. Address: 27 Taranaki Street, Masterton.
  Kelly was educated at Whenuapai School and Wairarapa College (boarder, prefect). He then completed
  a NZ Certificate of Engineering (Production) and an NZIM Diploma of Management. He is an engineer
  and supervisor for Juken Nissho in their Masterton laminated veneer lumber factory. Kelly spent 5
  months in Japan in 1991 training in Japanese plywood manufacturing processes.
  Kelly and Phillipa believe in the value of a Christian foundation in education and are
  homeschooling their children.
